import React from "react";
import "./Keep.css";
const Header = () => {

return(
    <>
      <div className="header fixed-top">
          <img src="https://www.gstatic.com/images/branding/product/1x/keep_48dp.png" alt="logo" />
          <h1> Google Keep</h1>
      </div>
    </>
);
};
export default Header;
